import React from 'react';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import AdminRegister from './components/AdminRegister';
import AdminLogin from './components/AdminLogin';
import AdminDashboard from './components/AdminDashboard';

function App() {
  return (
    <div className="container-fluid">
      <BrowserRouter>
        <header className="bg-danger text-white text-center p-2 mt-2">
          <h2><i className="bi bi-cart4"></i> I-Shop</h2>
        </header>
        <div className="row mt-3">
          <div className="col-3">
            <Link className="btn btn-danger w-100 mb-2" to="/adminregister">Admin Register</Link>
            <Link className="btn btn-danger w-100 mb-2" to="/adminlogin">Admin Login</Link>
            <Link className="btn btn-danger w-100" to="/admindashboard">Admin Dashboard</Link>
          </div>
          <div className="col-9">
            <Routes>
              <Route path="/adminregister" element={<AdminRegister />} />
              <Route path="/adminlogin" element={<AdminLogin />} />
              <Route path="/admindashboard" element={<AdminDashboard />} />
            </Routes>
          </div>
        </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
